import './projects.css'

const Projects = () => {

    const searchProjects = async (title) => {
        const response = await fetch(`/seachProjects${title}`)
        const data = await response.json();
        console.log(data)
    }

    useEffect(() => {
        searchProjects();
    }, [])

    return(
        <div>

        </div>
    )
}

export default Projects;
